import { useEffect, useState } from "react";
import styled from "styled-components";

const Conteiner = styled.div`
    margin: 5px 0;
    overflow: scroll;
`
const Wrapper = styled.div`
    border: 1px solid cornflowerblue;
`
const UserInf = styled.div`
    border: 1px solid cornflowerblue;
    display: flex;
    justify-content: left;
`
const Content = styled.div`
    display: flex;
    flex-direction: column;
    justify-content: center;
`
const Div = styled.div`
    background-image: url(https://www.google.com/url?sa=i&url=https%3A%2F%2Fm.news.nate.com%2Fview%2F20240627n33005&psig=AOvVaw2oYVQ0al5-92TY3t1l_wJV&ust=1724825799894000&source=images&cd=vfe&opi=89978449&ved=0CBQQjRxqFwoTCMCS3fvClIgDFQAAAAAdAAAAABAE);
    width: 150px;
`

export default function Home(){
    const [userinf, setUserinf] = useState([]);
    useEffect(()=>{
