    },[])
    return(
        <Conteiner>
            <Wrapper>
                <UserInf>
                    <h1>박설호</h1>
                </UserInf>
                <Content>
                    <Div></Div>
                </Content>
            </Wrapper>
        </Conteiner>
    );
}
